import React from 'react';
import './Skills.css';

const Skills = () => {
  return (
    <div className="skills-container">
      <h1 className="section-title">Мои навыки</h1>
      <p className="section-subtitle">Технические компетенции и инструменты</p>

      <div className="skills-content">
        <p>Раздел находится в разработке...</p>
      </div>
    </div>
  );
};

export default Skills;
